import React from "react";
import "./index.css"

const Cert = () => {
    return <div className="container-fluid"> 
    <div className="container-fluid cert-header mb-5">The History behind the jewelry</div>
    {/* <img className="img-fluid cert-image mb-3" src="cert-image.jpg" alt="romanian-pillars"/> */}
    <div className="cert-text ">
        <p className="text-start" id="cert-text-header">From the Holy Land & the Roman Glass</p>
    </div>
    </div>
}

export default Cert;
